First, let's add the numbers column by column, starting from the rightmost column.

Column 1 (1s place): 5 + 8 = \boxed{D}

Column 2 (16s place): D + 0 = \boxed{D}

Column 3 (256s place): 6 + 8 = E (since 14 in base-10 is E in base-16)

Column 4 (4096s place): C + 7 = 13 (since 12 + 7 = 19 in base-10, and 19 in base-10 is 13 in base-16)

So, the result is \boxed{13EDD}.
